import React from "react";

const ContactsList = ({ contacts }) => {
  return (
    <ul>
      {contacts.length === 0 ? (
        <li>Нет контактов</li>
      ) : (
        contacts.map((contact) => (
          <li key={contact.id}>
            {contact.name} - {contact.number}
          </li>
        ))
      )}
    </ul>
  );
};

export { ContactsList };
